import React from 'react'
import {Link} from 'react-router-dom'
import {NavLink} from 'react-router-dom'
import {useAuth} from './auth'
const Navbar = () => {
    const auth=useAuth()
  return (
    <div>
      <nav className='nav1'>
        
        {!auth.user &&
        <NavLink to="/Login">Admin</NavLink>}
        
      </nav>
    </div>
  )
}
export default Navbar
